// Card.jsx
import React from "react";

const Card = ({ attributes, onToggle }) => {
  const { revealed, health, profession, hobby, age, phobia } = attributes;

  return (
    <div className="card">
      <h2>Карточка</h2>
      <p>Здоровье: {revealed ? health : "---"}</p>
      <p>Профессия: {revealed ? profession : "---"}</p>
      <p>Хобби: {revealed ? hobby : "---"}</p>
      <p>Возраст: {revealed ? age : "---"}</p>
      <p>Фобия: {revealed ? phobia : "---"}</p>
      <button onClick={onToggle}>{revealed ? "Скрыть" : "Открыть"}</button>
    </div>
  );
};

export default Card;
